VALUES
	(78,'携程旅行','1F412214005135.png','1F412214011U8.jpeg,1F41221401H91.jpeg,1F412214024R5.jpeg,1F4122140301N.jpeg',166,'携程计算机技术（上海）有限公司','<p>携程旅行】\r\n随时随地预订酒店、机票、火车票、汽车票、景点门票、用车，团购、跟团游、周末游、自由行、自驾游、邮轮、旅游度假产品任您选！畅享旅游攻略、旅游保险、旅行特惠。出行、旅游不用愁！\r\n【活动】\r\n- 春季大促进行时！领千元红包去旅行！热门景点￥9起，连锁酒店7.5折起，爆款旅游3折起！</p>',3.5,273915,'5a12fc4dcc69f.apk',54.23,1,'ctrip.android.view',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'7.8.2','ctrip.base.component.CtripBaseApplication','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=ctrip.android.view',1),
	(81,'淘宝','1F41221462CR.png','1F412214630344.jpeg,1F412214635414.jpeg,1F412214643M9.jpeg,1F41221464aV.jpeg',169,'淘宝（中国）软件有限公司','<p>国内最大的网上购物商场，支持票务购买。</p>',5.0,276247,'59f3591ca226e.apk',75.52,1,'com.taobao.taobao',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'7.1.3','android.taobao.atlas.startup.AtlasBridgeApplication','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.taobao.taobao',1),
	(82,'QQ阅读','1F412214Tb28.png','1F412214U3137.jpeg,1F412214US16.jpeg,1F412214Z4210.jpeg,1F4122149105O.jpeg',105,'上海阅文信息技术有限公司','<p>《琅琊榜》《云中歌》《鬼吹灯》不一样的结局在这里。</p>',5.0,275050,'5a0087519aa13.apk',15.85,1,'com.qq.reader',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'6.5.6.888','com.qq.reader.ReaderApplicationImp','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.qq.reader',3),
	(88,'小米金融','1F412220IOA.png','1F412220J2N2.jpeg,1F412220JO41.jpeg,1F412220K2935.jpeg,1F412220KI32.jpeg',72,'北京小米移动软件有限公司','<p>小米金融是个人综合金融服务平台，提供保险、贷款、理财等金融服务。</p>',4.5,268630,'5959f742ee4af.apk',12.09,0,'com.xiaomi.jr',0,31.65,21,1825,0,0,0.00,0,0,100,'期限丰富，安全稳定',0,0,'5.1.1','com.xiaomi.jr.MiFinanceApp','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.xiaomi.jr',1),
	(93,'云端金融','1F412221P4X6.png','1F412221QI12.jpeg,1F412221R35L.jpeg,1F412221RT61.jpeg,1F412221S4K3.jpeg',33,'杭州云端金融信息服务有限公司','<p>云端金融——专注于超短期理财的财富管理专家\r\n“云端金融”兼顾收益与流动性的平衡，借款人为大型国有企业及大型民营企业或上市公司等配套的贸易商，资金主要用于公司的贸易经营，一般单个项目的经营周期在3-5天。所合作的企业经营状况良好，实力雄厚，且有大量稳定应收账款，货物流及资金流均可实时监控，保障资金的良好、快速周转。账户资金由云端金服进行严格风控，资金按天计息，利率依据所投项目的综合收益每日计算，并于当日00：00进行定时更新。</p>',3.0,268228,'5954accedfe08.apk',10.39,0,'cn.ydjr.app',0,16.00,13,49,0,0,0.00,0,0,500,'收益日结，随时取现',666,0,'2.2.4','cn.ydjr.app.StoneApp','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=cn.ydjr.app',1),
	(99,'汉堡','1F41222325Y45.png','1F412223312233.jpeg,1F41222331O27.jpeg,1F412223322947.jpeg,1F41222332MW.jpeg',17,'Magma Mobile','<p>想成为超级员工吗？ \r\n这是Magma Mobile最新的一个模拟餐厅服务员的免费游戏。设计非常精美！ \r\n在这个游戏中，你将在一个连锁餐厅里当服务生，需要尽量快速的服务客人，以帮你自己赚到更多的钱和消费。从你客人那里接收订单，菜单里包含三明治，配菜，点心和苏打。你玩得越多，食材就越多！ \r\n如果敢接受挑战就试试职业模式吧，在里面你将每天遇到日益困难的关卡！</p>',2.0,273053,'5959f7561b41d.apk',8.76,1,'com.magmamobile.game.Burger',0,NULL,NULL,NULL,NULL,NULL,NULL,12,26,NULL,NULL,0,0,'1.0.15','.App','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.magmamobile.game.Burger',NULL),
	(123,'我的汤姆猫','1F41G3523aU.png','1F41G35245557.jpeg,1F41G35250a4.jpeg,1F41G3525X51.jpeg,1F41G3530L24.jpeg',16100,'Outfit7 Limited','<p>体验在 135 个国家排名第 1 位的游戏应用！领养专属于你的猫咪宝贝，并帮助他成长为猫咪帅哥吧！悉心照料你的虚拟宠物, 为他取名并让他成为你生活的一部分－喂他，和他玩耍，培养他成长。\r\n其他配件中选择，以你喜爱的任何方式来打扮他。布置他的小窝，还可以去看看别人是如何布置他们的“我的汤姆猫”的家。与你的汤姆一起开心玩游戏，看着他慢慢成为你日常生活的一部分。\r\n特性： 畅玩 10 个迷你游戏：果冻连线、泡泡射手、星球跳跳跳 、连及更多！！赢取金币、乐趣无穷！</p>',5.0,277352,'59d7aaffcda0a.apk',78.37,1,'com.outfit7.mytalkingtomfree',0,NULL,NULL,NULL,NULL,NULL,NULL,13,28,NULL,NULL,0,0,'4.3.5.110','com.outfit7.engine.EngineApplication','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.outfit7.mytalkingtomfree',1),
	(126,'汤姆猫跑酷','1F41G35T4Z2.png','1F41G35TX48.jpeg,1F41G35U51Z.jpeg,1F41G35Z2H8.jpeg,1F41G35ZG23.jpeg',600320,'天津百度紫桐科技有限公司','<p>你被打劫啦！探索无穷无尽的跑酷世界，让会说话的汤姆或会说话的安吉拉追强盗，夺回你的金子！\r\n不断发现新场景，体验不同跑酷风格，跑酷途中拾取加速器。\r\n酷跑有回报 - 你将能从零开始建造梦中的那个家……\r\n★ 追强盗夺回你的金子，并建造你的梦中之家\r\n★ 解锁各种新场景，其永无止境的跑酷机制各不相同</p>',3.5,273771,'59cbceee7136e.apk',77.4,1,'com.tencent.tmgp.com.outfit7.talkingtomgoldrun',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'2.0.0.1','com.outfit7.talkingtomgoldrun.HifunApplication','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.tencent.tmgp.com.outfit7.talkingtomgoldrun',NULL),
	(127,'神庙逃亡2','1F41G4214S96.png','1F41G42154464.jpeg,1F41G4215X18.jpeg,1F41G42203958.jpeg,1F41G4220a93.jpeg',4634,'深圳市创梦天地科技有限公司','<p>在快节奏的生活中，终日蹙眉凝神的人们，终于迎来了愚人节，一年中在这一天可以放下所有的禁忌，如淘气的孩童般任性一回，不也是别一种幸福与轻松吗？而在这个欢乐好玩的节日来临之际，《神庙逃亡2》将推出全新愚人节版本，全新道具模式趣味玩法，带给你不同以往，超乎想象的跑酷乐趣！ \r\n新增内容： \r\n1、道具赛 全新升级玩法</p>',5.0,276452,'5a00883f878df.apk',74.64,1,'com.imangi.templerun2',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'4.2.0','com.tencent.StubShell.TxAppEntry','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.imangi.templerun2',3),
	(128,'神偷奶爸小黄人快跑','1F41G42425927.png','1F41G424352V.jpeg,1F41G42442Z4.jpeg,1F41G4263QP.jpeg',4230000,'北京万盛和泰科技有限公司','<p>《神偷奶爸：小黄人快跑》继“果酱工厂”后再度迎来重量级更新！激烈又欢乐的“多人对战”劲爆来袭！！！你~准备好和好友在“小黄人赛跑”模式中一决高下了吗？</p>',4.5,273745,'5970ab1b99618.apk',125.34,1,'com.gameloft.android.ANMP.GloftDMCN',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'4.2.3','com.gameloft.android.ANMP.GloftDMCN.GameApplication','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.gameloft.android.ANMP.GloftDMCN',NULL),
	(131,'周末去哪儿','1F41Z932443H.png','1F41Z9324Wb.jpeg,1F41Z932524Q.jpeg,1F41Z9325KB.jpeg,1F41Z93303L9.jpeg',112,'上海西示网络科技有限公司','<p>“周末去哪儿”是一款专注于让人们体验更美好的周末生活而存在的人气活动精选应用。你可以在”周末去哪儿“里找到好玩的市集，口味各异的展览，精致特色的下午茶。也可以约上朋友预订精彩纷呈的剧场、报名品种多样的DIY、参加可嗨可雅的音乐节。这么酷炫的活动，周末还会无聊吗，带上小伙伴一起出来嗨吧！</p>',3.0,275051,'59cbd05649bfc.apk',19.59,1,'com.xisue.zhoumo',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'6.0.1','com.tencent.StubShell.TxAppEntry','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.xisue.zhoumo',3),
