	(141,'模拟城市:建造','1F419100REB.png','1F419100S0594.jpeg,1F419100SJ12.jpeg,1F419100T2349.jpeg,1F419100TK03.jpeg',1710162944,'北京北纬通信科技股份有限公司','<p>「模拟城市：建造 SimCity BuildIt」是一款EA推出的模拟城市游戏。在「模拟城市」系列里，玩家最大的任务就是就是在一个固定范围的土地上，满足城市内所有市民的日常生活所需。从规划住宅、商业及工业用地，建到税金及各种公共设施支出的分配都由玩家自行设计。游戏中除了要妥善规划各种区域，还要考虑到人、经济、生存及政治等多项因素。玩家可以自由规划心目中的理想城市，并慢慢看着城市随着时间而发展。</p>',5.0,273140,'59f35be9a0c0a.apk',93.52,1,'com.ea.simcitymobile.tx',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,'0.11.171016.2891','com.ea.common.SCBIApplication','1493300086','http://android.myapp.com/myapp/detail.htm?apkName=com.ea.simcitymobile.tx',NULL),
