	(345,'即嗨比分','1FGF95315115.png','1FGF953231R.jpg,1FGF9532Q11.jpg,1FGF953331K.jpg,1FGF95339C6.jpg',NULL,'freferfe','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\" style=\"height: 483px;\"><div class=\"det-app-data-info\">做专业的足球竞猜数据比分直播。<br/><br/>【性状】本品有三大特色<br/><br/>1.比分直播——快、全、准<br/>手机随时看比分，比电视直播快2秒嗨爆每一天。我们免费提供快、全、准的足球比分直播！竞彩比分、足彩比分、单场比分一网打尽！<br/><br/>2.赛事推荐——专业、实用、深度<br/>媒体大咖、资深实战高手及权威足彩专家名人汇集地，命中率高达90%，与专家一起开启长红之旅。<br/><br/>3.核心数据——精细、准确、权威<br/>提供各大赔率公司足球即时赔率、即时盘口、标准盘、赔率比较、盘路走势、历史相同赔率。与国内外百家赔率公司结成战略合作伙伴，独具特色的即嗨竞猜比赛指数，重新定义核心数据！<br/><br/>【功能主治】主治竞猜不中全国通用病，连连输钱恐慌症、专家不靠谱等顽疾。对灯神附体的人效果明显。<br/>【有效期】有生之年，永不失效<br/>【惊人疗效】比分直播+赛事情报+核心数据+游戏玩法=中奖幸运福地</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1.资料库中可以关注球队啦，即刻锁定你的信仰！<br/>2.赛事筛选加入一级赛事，重要战役不容错过！<br/>3.发现页改版再次来袭，即嗨大咖等你入驻！<br/>4.新增文章举报，即嗨需要你的肯定！<br/>5.程序猿哥哥已修复若干BUG及其他优化</div></div><p><br/></p>',5.0,267871,'1FGF95250512.apk',NULL,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',1),
	(346,'欢乐球吃球','596c1c8d5d474.png','596c1c8c52b21.jpg,596c1c8caaf54.jpg,596c1c8cdaa40.jpg,596c1c8d109c3.jpg,596c1c8d2c80b.jpg',NULL,'腾讯','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">【游戏简介】《欢乐球吃球》是北极光工作室出品的腾讯首款创新休闲竞技手游。游戏采用大球吃小球经典玩法，操作简单易上手，又融入Q萌可爱的精灵收集，道具乱斗的创新玩法和线上线下的亲密社交圈。在游戏中既可组CP、撩萌新，联手基友闺蜜叱咤双人模式；也能加战队、组稳团，5人排位一路并肩超神！赶快加入《欢乐球吃球》，趣味无穷，一口吃定你！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">【游戏特色】1、自由组队，CP打团就缺你2、道具乱斗，绝地逆转无处不在3、颠覆传统，养成协作圈地欢脱4、萌球收集，总有一款适合你</div></div>',5.0,271293,'',NULL,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.tencent.tmgp.hlxq',0),
