	(356,'派派','596cb361c1a9a.png','596cb36111f33.jpg,596cb36134026.jpg,596cb3614a60f.jpg,596cb36172f5c.jpg,596cb361aba5b.jpg',NULL,'北京畅聊天下科技股份有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">派派是一款超新颖的熟人社交APP，带来熟人之间全新社交方式，让熟人之间的互动更有趣。所推出的包括“偷好友现金红包”、 “整蛊熟人“”、”萌宠PK“、“形象Show”等主要功能彻底颠覆了以往熟人社交应用，让用户获取全新的体验感受，引领了时下最时尚的社交方式。\r</br>功能介绍\r</br>1.偷好友现金红包：偷好友红包刺激的像当年偷菜一样，偷到的好友红包还可以直接提现，充分满足你的成就感。派派红包发不停，好友欢乐每一天。\r</br>2.整蛊熟人：可以整蛊你的熟人好友(包括通讯录、微信、微博、QQ好友等)，抓熟人好友来暖床、跳舞或者是刷马桶，更可以让他们来为你打工，必须为你任劳任怨。\r</br>3.百变衣柜：可以通过收集服装碎片、找个跟班打工获得图纸、抢夺邻居或好友获取材料来制造喜欢的服装，打造自己独一无二、个性十足的衣柜。\r</br>4.Q萌宠物：养个宠物找熟人好友PK，赢了能把好友抓来暖床跳舞刷马桶，让你和熟人好友互动更有趣。快来领养超Q的萌宠来为你战斗吧。\r</br>5.动态表情：超震撼的动态表情铺满全屏，对面的好友更能感受你的诚意满满。</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">全新上线语音直播间版本</div>\r\n            </div>\r\n            ',5.0,271293,NULL,NULL,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.ifreetalk.ftalk',0),
