	(371,'花点借款','596cb46dd9a22.png','596cb46d4542a.jpg,596cb46d6d47c.jpg,596cb46d8cd05.jpg,596cb46d9ddb6.jpg,596cb46dbb35f.jpg',NULL,'杭州花点科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">花点是一款致力为白领上班族，工薪族提供借钱信息服务的APP，从此借钱不求人。1.&nbsp;闪电式放款：可快2分钟到款，到账极快；2.&nbsp;期限可选：7-14天借款周期； \r\n3.&nbsp;极速审核：一键注册，系统自动审核；4.&nbsp;手机：手机直接申请借钱，无担保；5.&nbsp;保障措施：保护您的个人信息隐私。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1.优化产品流程、</div></div>',4.0,268183,'',NULL,1,NULL,0,0.00,0,0,0,0,0.00,0,0,0,'',0,0,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=cn.huadian.huadian',0),
	(372,'去哪儿旅行-酒店.火车','596cb48847109.png','596cb487975f4.jpg,596cb487c98b3.jpg,596cb487e1a64.jpg,596cb4880619f.jpg,596cb48817ecb.jpg',146,'北京趣拿软件科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">去哪儿旅行—总有你要的低价！\r</br>作为中国领先的无线和在线旅游平台，去哪儿旅行支持用户低价购买近60万条国内国际航线，42万家国内酒店、16万家国际酒店；超100万条国内外度假线路和2万种景点门票；享受国内160座城市，以及国外86座城市的在线叫车、自驾等服务。\r</br>通过移动客户端的全平台覆盖，去哪儿旅行有吃住行游购娱一站式解决方案，随时随地搜索和预订国内外机票、酒店、度假、租车、接送机、火车票和团购等旅行信息。超过80%的低价占比和全面丰富的旅行产品，帮助旅行者找到性价比高的产品和优质的的信息，聪明地安排旅行。\r</br>去哪儿网移动客户端“去哪儿旅行”是中国旅行类较受欢迎的移动应用，目前拥有超过10亿的激活下载量，增速高于行业平均水平，总用户量、以及月度覆盖人数位居榜首。中国互联网络信息中心发布的中国网民在线旅行预订行为调查报告中，去哪儿旅行客户端总用户下载量居首，活跃用户突破3000万大关。</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">【酒店】订单信息清楚明了，入住问题极速解决；新增团队房预订，多间享优惠。【火车票】大交通方案，订制海陆空旅行；抢票成功再付款，更鼓励去商店给抢票好评哦。【汽车票】新增个性化包车，多人出行省心又便宜。【度假】青春范儿闪亮登场，打造年轻化商品，途young途simple；度假首页专属目的地推荐，你的喜好我知道。</div>\r\n            </div>\r\n            ',4.0,268182,'5971b8109acf0.apk',37.76,1,'com.Qunar',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'8.6.1','com.mqunar.spider.QunarApp',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.Qunar',0),
