	(375,'身份证借款','596cb4a50ef87.png','596cb4a481156.jpg,596cb4a4b4712.jpg,596cb4a4db8df.jpg,596cb4a4f1851.jpg',NULL,'上海商域网络科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">在线手机贷款，就选身份证借款。内有多款贷款产品，各有不同特性，满足不同人群的需要。从16岁到60岁，从学生到白领企业家，从2000元到10万元，借款限制少，通过率高，智能化审核，挑战极限的放款速度。【贷款特色】 简单：手机注册，按指导3步填写借贷申请，流程简单； 审核快速：系统结合模型与用户申请，智能匹配合适的借钱产品，为用户做出精准推荐； 放款快：审核通过就放款，平均速度10分钟； 易通过：多种网贷产品，一次性申请几十个，通过率更高； 额度灵活：2000元——10万元；【还款亮点】 低息：利息低至0.16%起，还款更容易； 分期：长达24个月的分期，还信用卡一样还贷款； 查征信：提升自己的征信，就能提高贷款的通过率。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">优化系统性能，体验更顺畅。</div></div>',5.0,268183,'',NULL,1,NULL,0,0.00,0,0,0,0,0.00,0,0,0,'',0,0,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.sfzjk.credit',0),
	(376,'同花顺手机炒股股票软件','596cb4b8a20e9.png','596cb4b818d21.jpg,596cb4b835cba.jpg,596cb4b853326.jpg,596cb4b87322d.jpg,596cb4b88aa0b.jpg',NULL,'浙江核新同花顺网络信息股份有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">同花顺(300033)手机炒股 股票软件是市场上实时行情、极速交易、数据全面、支持券商众多、领先支持股指期权 和 沪港通，深受股民欢迎的免费炒股(金融/投资/理财/证券)软件。 众多券商：支持全国众多券商在线交易 (如平安证券、银河证券、方正证券、中泰证券、东方证券、兴业证券) 闪电下单：分时快买快卖，投资下单快人一步 模拟炒股：免费20万资金，快速学会炒股 自选股：多平台云同步，随时掌握自选股信息 全面行情：沪深行情、基金、实时港股、美股、全球股指、期货、外汇等 股价预警：离线盯盘 主力监控：实时追踪大单资金流向，主力动向一目了然 股指期权：首家推出股指期权行情及股指期权交易，规避风险尽在掌握 沪港通：全新投资机会，免费港股Level-2尽在掌握 融资融券：支持多家券商融资融券 预约开户：闪电预约、快速开户，一键完成开户，万二低佣金宝开户 不管你想学习股票入门知识，还是炒股技巧、炒股绝招，炒股票高手就用同花顺！ 老牌炒股软件同花顺，凭借十多年为千万股民服务经验及股民口口相传，在大智慧、东方财富通，益盟操盘手，和讯股票等中脱颖而出，是股民一致选择！</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">新增截图编辑功能，分享股票，一步到位！\r</br>港美股新增退市预警消息提醒，有风险，即刻知！\r</br>港美股首页新增港股、美股新闻，查看方式：首页菜单--港股美股\r</br>新增防劫持功能，全面提升客户端安全性\r</br>委托登录页面、港美股交易页面UI调整，显示效果更规范\r</br>手表也能查看股票，同花顺支持Android Wear 2.0手表</div>\r\n            </div>\r\n            ',5.0,268184,NULL,NULL,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.hexin.plat.android',0),
	(377,'懒人听书','596cb4cb3032e.png','596cb4caaec52.jpg,596cb4cac7400.jpg,596cb4cadf629.jpg,596cb4cb0603d.jpg,596cb4cb18474.jpg',NULL,'深圳市懒人在线科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">懒人听书是深受广大用户喜爱的移动有声阅读应用，2亿注册用户，3千万月活跃用户。 \r</br>懒人听书是有声阅读领域的Kindle，去除不必要的噪音及影响，一切产品设计都为保障用户的听读体验。\r</br>产品特性 \r</br>1.海量资源：8000多正版书籍、无数主播节目，每日更新。 \r</br>2.上传节目：所有用户都是懒人主播，可自由上传随时收听。 \r</br>3.下载收听：所有书籍、节目免费下载。 \r</br>4.交流社区：与主播和同好听友即时互动交流。 \r</br>5.云端同步：支持iOS、Android、Web等多平台数据同步。 \r</br>6.使用简便：去除多余的功能，老人小孩可以快速上手。 \r</br>7.睡眠模式：睡眠模式支持定时关闭、定集关闭。 \r</br>8.文本同步：边听边看，绘声绘色。 \r</br>联系方式 \r</br>官方网站：http://lrts.me \r</br>新浪微博：@懒人听书微博 或 http://weibo.com/lanrentingshu \r</br>微信帐号：懒人听书 或 lazyman-on\r</br>联系邮箱：service@lazyaudio.com</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">修正已知的异常问题。\r</br>\r</br>近期已更新：\r</br>1.优化首页、书籍详情页、分类推荐页等页面，更清爽，找书更方便；\r</br>2.在详情页和购买面板中显示折扣信息；\r</br>\r</br>《楚乔传》、《悟空传》，性急的人都在懒人听书上抢先收听大结局。\r</br>央视中国电视剧制作中心导演、演播艺术家李野墨演播的《白鹿原》正在懒人听书上热播。</div>\r\n            </div>\r\n            ',4.0,268183,NULL,NULL,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=bubei.tingshu',0),
	(378,'现金贷信用卡借款','596cb4d49ee25.png','596cb4d40758d.jpg,596cb4d43a75a.jpg,596cb4d4532f5.jpg,596cb4d47f222.jpg',NULL,'杭州道安广告有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">现金贷信用卡借款是一个贷款搜索信息服务借款平台，致力于为上班族、中小微企业提供金融贷款产品搜索，贷款推荐服务，业务涵盖极速贷，金融贷款，现金分期贷款，小额贷款，大额贷款，信用卡贷款、公积金贷款等借贷服务以及信用卡办理1. 解决【贷款】难题- 全面解决：个人消费贷、企业经营贷、车房装修贷、出行旅游贷、学习进修贷、投资理财贷- 放款效率：一天即可放款- 利率优势：月利率0.3%起。还款期限3个月起- 门槛较低：无需抵押，资质低到只需身份证- 产品多样：超7万款产品，全部由正规金融机构(含银行)提供2. 解决【办理信用卡】难题- 在线申请：所需资料在线填写。信贷员上门办理- 批卡快速：在线填写后，资料直接进入银行的总行审批流程- 种类繁多：现可办理9家银行的百余种信用卡- 自由筛选：可根据办卡主要目的选择适合的信用卡【平台特色】1、极速贷款：多种贷款机构，方便用户借钱、借款、贷款，手机贷款实现当天审核，当天放款2、征信服务：通过大数据分析技术智能匹配您的征信3、产品多样：由贷款机构和金融机构提供丰富的借贷产品，信息安全可靠4、操作简单：这是一个实现手机贷款，网贷分期，让小白也能借钱的网贷平台</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1、用图形验证码代替短信验证码；2、优化已知bug，有利于用户体验的提升；</div></div>',5.0,268182,'',NULL,1,NULL,0,0.00,0,0,0,0,0.00,0,0,0,'',0,0,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=cn.daoan.xianjinloan',0),
