	(393,'快牙','596e078e3761c.png','596e078d582ec.jpg,596e078d6f525.jpg,596e078d95973.jpg,596e078dad575.jpg,596e078dc4f8a.jpg',187,'邻动网络科技（北京）有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">全民网络资源获取、共享、传输的一站式服务平台\r</br>昨天，4.5亿网民使用快牙\r</br>因为她是传输速度极快，使用超级便捷的文件传输工具\r</br>今天，快牙已是数亿人共享的私藏片库\r</br>千万高清无广告视频，为您呈现最精彩的世界，24小时刷不停\r</br>传输优势\r</br>【零流量】无需流量、无需WiFi，与好友互传无需任何消耗\r</br>【极速传】传输速度可达10Mb/S，速度秒杀蓝牙128倍\r</br>【跨平台】支持手机、电脑、平板多个平台互传\r</br>【多人群】支持最多5人的群组分享和离线聊天\r</br>内容优势\r</br>【精彩视频】人工智能算出你的喜好，搜罗全网视频给你\r</br>【影视达人】1000位影视人，推荐各类影视剧集\r</br>【私藏片单】生成自己的影视片单，可分享可下载\r</br>【全民共享】数亿用户分享私藏视频，奥妙等你探索\r</br>产品特色\r</br>海量影视资源，免费不含广告\r</br>达人带你看片，高效观影体验\r</br>一键无缝连接，极简传输体验\r</br>传输不耗流量，多人完美共享\r</br>影视达人片单介绍(每日更新)\r</br>1、杀戮女神大盘点\r</br>2、十大猜不透结局的烧脑片\r</br>3、吓尿你的恐怖电影精选\r</br>4、让你口水流不停的美食佳片\r</br>5、少女的奇妙能力合集\r</br>任何问题和意见，请联系feedback@dewmobile.net</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">1.进一步丰富影视、娱乐、搞笑、音乐等视频内容；\r</br>2.新增小窗口播放，边播边选互不耽误；\r</br>3.优化搜索体验，输入关键词更加便捷；\r</br>4.优化安装体验，安装包大小减少15%。</div>\r\n            </div>\r\n            ',4.0,268196,'596e07837315b.apk',6.58,1,'com.dewmobile.kuaiya',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5.0.1 (CN)','com.dewmobile.kuaiya.app.MyApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.dewmobile.kuaiya',0),
	(394,'重卡归来','596ec3a790b4b.png','596ec3a614e2f.jpg,596ec3a67838b.jpg,596ec3a6eeab2.jpg,596ec3a72da20.jpg',307,'厦门云动网络科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">重卡归来（中文版）是一款3D停车游戏游戏中车由车头跟车尾组成刚开始是只有车头相对比较简单后面会出现车尾在有车尾的情况下，你需要控制车头对准游戏中的半透明车头然后通过连接按钮，连接车尾在有车尾的情况下车的控制感会不同于只有车头的情况下在有带车尾的情况下，可以通过减慢速度，一边跳油门一边打方向顺利通过好好体验一把吧</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">添加倒车关卡</div></div>',3.0,268195,'596ec3868b70a.apk',17.7,1,'com.icloudzone.TruckPark3D',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.3.7',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.icloudzone.TruckPark3D',0),
