	(396,'同花顺手机炒股股票软件','5970ab8b300c9.png','5970ab8a2a9b8.jpg,5970ab8a3b7a4.jpg,5970ab8a97094.jpg,5970ab8aa5141.jpg,5970ab8b0cc19.jpg',4296,'浙江核新同花顺网络信息股份有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">同花顺(300033)手机炒股 股票软件是市场上实时行情、极速交易、数据全面、支持券商众多、领先支持沪港通，支持多家券商融资融券，深受股民欢迎的完全免费的炒股(金融/投资/理财/证券)软件\r</br>众多券商：同行业中支持全国众多券商在线交易\r</br>(如中泰<齐鲁>证券、方正证券、银河证券、东方证券、兴业证券等)\r</br>闪电下单：分时快买快卖\r</br>新股申购：随时随地申购新股\r</br>模拟炒股：免费获20万资金，新手快速学会炒股要点\r</br>自选股：多平台云同步，随时随地掌握自选股信息\r</br>全面行情：沪深行情、基金、实时港股、美股、全球股指、期货、外汇等\r</br>股价预警：实时监控，离线盯盘\r</br>主力监控：实时追踪大单资金流向，主力动向一目了然\r</br>精选资讯：海量专业资讯，股市热点、机会情报、板块概念、涨停股揭秘、个股机会\r</br>沪港通：免费港股Level-2\r</br>融资融券：市支持多家券商融资融券\r</br>预约开户：闪电预约开户、迅速简单开户，轻松完成开户，更有全网万二低佣金宝开户等你来\r</br>\r</br>不管你想学习股票知识，还是炒股绝招，成炒股票高手就用同花顺！\r</br>老牌炒股软件同花顺,凭借十多年为千万股民服务经验,在大智慧、东方财富通,益盟操盘手,和讯股票,自选股等一应软件中,是股民们一致选择!</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">1、上证指数新增大盘异动功能，掌控市场异动，轻松把握市场热点！\r</br>2、全新的自选股分组功能来袭，自由分组、自由编辑终于等到你！\r</br>3、新增交易模块资产隐藏按钮，有财不外露，低调赚大钱！\r</br>4、黄金、贵金属等新增新闻列表，有动态即刻知！</div>\r\n            </div>\r\n            ',5.0,268295,'5970ab5aa5ffe.apk',26.81,1,'com.hexin.plat.android',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'V9.43.06','com.hexin.plat.android.HexinApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.hexin.plat.android',0),
	(397,'TIM-QQ轻聊版','5970ac1226c5a.png','5970ac112a712.jpg,5970ac1184719.jpg,5970ac119399b.jpg,5970ac11bc500.jpg,5970ac121508a.jpg',930,'腾讯','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">TIM，轻聊的QQ，更方便办公。登录后你的QQ好友都在，消息无缝同步，还能享受在线文档等好用的办公功能。主要功能：沟通：支持手机电脑多平台，多端消息漫游同步。联系人：QQ登录后，联系人全同步，还可以将部分不常用联系人隐藏。在线文档：可以多人在线编辑Word文档和Excel表格。日程：创建日程，安排事务，还能做会议邀请。邮件：收发邮件无压力，还可以收非QQ邮箱的邮件。文件传输：使用QQ底层技术，传文件，快！电话会议：异地沟通？用TIM打个电话吧。收藏：有用的文字、图片和链接等都能收藏进来。官方网站：office.qq.com意见反馈：请登录TIM，进入“设置-关于”进行反馈。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">新功能：- 在聊天界面点击日程时，可以新建日程和分享我的日程- 日程界面支持周视图展示- 新建日程时，可以设置日程重复提醒（例如：每天、每周、每月）- 全局搜索支持搜索在线文档优化：- 将联系人中的“我的设备”提到好友分组最前面- 优化了邮件功能的部分细节体验- 精简代码，缩减安装包大小- 屏蔽了送礼物等功能和动画- 修复bug若干：）</div></div>',4.0,268294,'5970ab971ac8d.apk',30.68,1,'com.tencent.tim',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.1.5','com.tencent.common.app.BaseApplicationImpl',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.tencent.tim',0),
	(398,'婚礼化妆','5971691f77346.png','5971691f11f98.jpg,5971691f3c2b0.jpg,5971691f610dd.jpg',216,'深圳市久正科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">Have you ever wanted to be a make up artist? Wedding Make Up is coming! Well now your can make up your girl step by step.All her friends have been trying to define her beauty, but finding a word for it is just impossible. Cause her beauty is simply wild, girls! Every single time you see her, you discover something new: her beautiful big eyes, her charming lips with a playful smile, her fabulous hair that changes so often, but that looks amazing all the time. Today you’re her guest in her beauty salon, to understand the secrets that make her as special as she is! Then you have to be her stylist, cause her dressing room is just so fabulous, she can’t decide alone! Ready to dive in a wild fashion fantasy?</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">1,新增更多化妆道具\r</br>2,优化应用性能，提高应用的稳定性</div>\r\n            </div>\r\n            ',4.0,268296,'59716912c3bcf.apk',7.85,1,'org.games.makeupbride',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.3','com.tencent.StubShell.TxAppEntry',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=org.games.makeupbride',0),
