	(400,'雷神传说-龙之力量','597169fac75a0.png','597169f9ab1b6.jpg,597169fa07c9a.jpg,597169fa207a4.jpg,597169fa3dbdb.jpg,597169fa587ea.jpg',1,'上海宝开软件有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">真实并非真理，光明也非正义，雷神之子，继承父辈之意志，去探寻那迷雾之中的阴谋旷世巨作诸神系列正统续作，超炫日韩风画面，超强的战斗特效，出乎意料的剧情，再度感受诸神世界的魅力</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">修复了一些BUG。</div></div>',3.0,268294,'597169f0685fa.apk',6.09,1,'com.gtw.sevn.game',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.0',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.gtw.sevn.game',0),
	(401,'史上最坑爹的运动会','59716adf3bae0.png','59716ade72009.jpg,59716ade8f68b.jpg,59716ade952b0.jpg,59716adeb417d.jpg,59716adeceeaf.jpg',15,'黄石市金舰网络科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">史上最令玩家伤不起、最令人抓狂的游戏，一款非常不错的解密小游戏，诙谐幽默游戏剧情及背景，喜欢这类游戏的童鞋们千万不要错过！各种吐血的恶搞的剧情，绝对能给你带来无限的乐趣，玩法更是令人抓狂，非常考验你的思维能力哦！奥运火炬手在前进路上，奥运圣火被邪恶的人熄灭了，火炬手非常沮丧，他要再次点燃圣火，在点燃圣火的过程中他遇到了很多的困难，这是一个充满欺骗和诙谐的体育世界，他会遇上什么诡异的事情呢？玩家需要使用触屏点击触发剧情，解开所有的谜团，帮助火炬手完成逆袭点燃圣火。各种狗血的玩法，千万不要放弃，挑战你的想象力哦！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1、修复一些关卡bug；2、修复部分机型无法运行；3、其他细节、兼容性问题。</div></div>',4.0,268295,'59716aa8a54f1.apk',16.78,1,'air.kedie.yundonghui.game',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.2.5','com.bangcle.protect.ApplicationWrapper',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=air.kedie.yundonghui.game',0),
	(402,'口袋妖怪火红中文版','59716b799a21b.png','59716b78c05f5.jpg,59716b792a55e.jpg,59716b79301f3.jpg,59716b7965dc2.jpg',705310976,'深圳市聆越森科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">游戏画面上采用红宝石/蓝宝石的游戏引擎加以强化在游戏一开始，玩家可以选择扮演男孩或者女孩，游戏最初有三只口袋妖怪，分别为：妙蛙种子、小火龙与杰尼龟想必大家对GB的口袋都不陌生，本作忠实还原当年GB上的感觉，并且对细节进行了大幅度的提升v3.1.5版本更新介绍：1、新增地图迷宫；2、支持神兽可定点捕捉；3、新增迪奥拉斯精灵登场与剧情；4、支持单机捕捉所有386只精灵并可单机进化；5、修正雪拉比剧情贴图错误</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1.修复了已知BUG \r\n2.提高了稳定性和系统流畅性3.添加了新的上古神兽.</div></div>',3.0,268295,'59716b6c3dc11.apk',8.04,1,'com.gamezu.redgamecn',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'7.05.3109.5503','com.qihoo.util.StubApp4042323455',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.gamezu.redgamecn',0),
	(403,'墨迹天气','59716ddace071.png','59716dd9bac13.jpg,59716dda0689c.jpg,59716dda44e15.jpg,59716dda69a41.jpg,59716ddac08c4.jpg',7000602,'北京墨迹风云科技股份有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">全球约5亿人在使用的天气APP，支持196个国家70多万个城市及地区的天气查询，准确定位及时推送，分钟级、公里级天气预报，实时监测阴晴雨雪。提供15天天气预报，5天空气质量预报，实时空气质量及空气质量等级预报。特殊天气提前发送预警信息，帮助用户更好做出生活决策，从容应对各类天气状况。\r</br>\r</br>墨迹天气7.0，打造全新视觉、交互、动画的极 致天气软件！\r</br>\r</br>空气质量指数：空气指数界面升级，五天之内逐小时精 准预报。\r</br>\r</br>实况天气：点击实时温度，开启实况详情；反馈你看到的天气，人人都是气象员。\r</br>\r</br>雾霾相机：空气质量页面新增相机功能，随时随地秀出你的AQI，空气新鲜看得见。\r</br>\r</br>墨迹资讯：个性化推荐，做更懂你的天气资讯。\r</br>\r</br>\r</br>\r</br>公司介绍\r</br>\r</br>    北京墨迹风云科技股份有限公司于2010年成立，是一家以“极\r</br>\r</br> 致、责任、创新”为公司理念，以“做最卓越的天气服务公司”为目标的新兴移动互联网公司。主要开发和运营的“墨迹天气”是一款免费的天气信息查询软件。墨迹天气目前已覆盖Symbian、Android、iOS、Windows、Win8、Winphone等平台。经过7年多的发展，墨迹天气已拥有过5亿用户，天气日查询次数过亿， Android、IOS双平台排名前20，中国生活服务类应用排名第2位，是全球下载量第\r</br>\r</br> 一的天气类应用。2014年，发布家用空气检测设备“空气果”，结合软硬件提供智能家居体验，在市场上得到很好的口碑及社会影响。2015年12月，基于上空气果一代的优势，迭代推出空气果1S，让空气清新看得见。2016年，创造性地提出“天气+”概念，以气象大数据为基础，以天气作为入口，提供给用户更多生活化、场景化的服务。\r</br>\r</br>创始人\r</br>\r</br>    金犁，墨迹天气创始人兼CEO，曾任职于诺基亚和埃森哲。2009年，怀着让人人都用上自己开发的软件的梦想，锁定天气产品的创业方向，设计并研发了“墨迹天气”的第 一个版本。随后在2010年成立北京墨迹风云科技股份有限公司，期望通过技术、产品体验创新，改变人们获取天气信息的方式。经过7年的发展，墨迹天气已成为全球最 大的天气服务类软件。</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">【新功能】\r</br>- 墨迹天气35℃计划冰临城夏，酷爽来袭。这一定是今年夏天你最不能错过的事情，快来参与吧！\r</br>- 墨迹天气35℃计划形象大使墨娜已现身全国门店，去寻找她可爱的身影吧，还可领取免费冰饮哟～\r</br>- 短时预报页面，新增加天气反馈功能入口。反馈你看到的天气，让预报更及时更精 准。\r</br>- 你反馈的天气信息一经采纳将会在第 一时间告知。人人都是预报员，墨迹天气感谢你的反馈。</div>\r\n            </div>\r\n            ',5.0,268294,'59716db4e885e.apk',13.57,1,'com.moji.mjweather',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'7.0006.02','com.moji.mjweather.MJApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.moji.mjweather',0),
	(404,'财付通','59716ddf4bc83.png','59716dde79c1c.jpg,59716dde999da.jpg,59716ddea01d3.jpg,59716ddf06e3c.jpg',40,'腾讯科技(深圳)有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">QQ财付通安卓版生活亲密小管家，2012智能手机必备软件，3亿人的选择，值得你拥有，QQ财付通安卓版是腾讯倾情研发之作-集无线支付和生活应用为一体的智能手机软件，只要拥有QQ号，让您弹指间尽享迅捷、优惠、无可比拟的无线便捷生活。想掌上支付 用QQ财付通，腾讯出品，让您财富无限交流融通。 功能特色： 1：只需知道对方QQ财付通帐号即可向对方付款。实时到账，免收手续费。 2：余额查询、明细、提现、付款，流水管理堪比专业财务管理软件。 3：支持银行一点通、移动\\联通\\电信充值、手机银行充值、储值卡充值等方式，无穷方便，支持多多。 4：余额支付、一点通支付、手机银行支付。</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">1、修复信用卡还款限额计算错误问题；\r</br>2、增加信用卡还款时，抵扣金额等于还款金额时的前端拦截报错；\r</br>3、修改关于中的版权信息。</div>\r\n            </div>\r\n            ',4.0,268295,'59716ddb59805.apk',2.24,1,'com.tenpay.android',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2.5.1','.TenpayApp',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.tenpay.android',0),
