	(416,'农场保卫战2','597170a239ed4.png','597170a19c3c8.jpg,597170a1dddd5.jpg,597170a1ea27a.jpg,597170a202b69.jpg,597170a21a1c1.jpg',NULL,'北京小奥互动科技股份有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">☆超千万玩家五星推荐的最具创新的塔防策略游戏！ </br></br>☆首届民族原创动漫形象大赛手机游戏类优秀奖！ </br></br>☆倍受广大玩家追捧的《农场保卫战》正式升级为《农场保卫战2》 啦！这次升级除了保留原游戏的精彩之处，在新版本中农场宝贝们为了更好的保卫阳光农场，召唤了自然之神的力量，游戏中可以启动“时光之轮”，为虫虫们加上冰冻状态，降低虫虫的移动速度，可以更好地抵御虫虫以及BOSS的高速冲击。另外还可以召唤“闪电风暴”瞬间秒杀全屏的虫虫。为了让玩家玩得更轻松，阳光勋章加入在商城中获得的方式，可直接升级武器到你想要的级别，痛快地打击入侵的虫虫吧！更多精彩，免费试玩，等您来体验。 </br></br>7*16小时客服为您开启，帮您解决游戏中所遇到的问题。 </br></br>客服电话：010-59799570</br>                        更多 </br>                    </br></br></br>                    </br>                        农场保卫战2 更新内容</br>                        夏季大换装，精美画质，精品体验；</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">夏季大换装，精美画质，精品体验；</div>\r\n            </div>\r\n            ',4.0,268295,'59717093e435a.apk',8.72,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.sxiaoao.android.farmTD2',0),
	(417,'欢乐盖大楼','5971710aa2bc3.png','5971710a0e797.jpg,5971710a1fce6.jpg,5971710a30b53.jpg,5971710a395e7.jpg,5971710a7ac3d.jpg',196,'北京星元素网络科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">欢乐盖大楼是今年难得一见的精品休闲游戏，独特的玩法，精致的画面，让人爱不释手。在游戏中，你可以修建精美商铺，豪华住宅，升级仓库，轻松收获千百万金币，建成众人仰慕的摩天大楼，缔造你的商业帝国！ \r\n1、收集好材料无限升级仓库，再也不愁容量有上限了！2、多间精美住宅随你选，能招好友来帮忙，真正亲密无间！3、数不清美食、服饰、休闲娱乐，在这里吃喝玩乐不用愁。 \r\n4、还有VIP大客户：唐僧、悟空、八戒等大人物来帮忙。 \r\n欢迎加入Q群：191910744 ，美女客服等你哟！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">重要更新：1、修复游戏BUG，优化游戏体验，更愉快地玩起来。2、欢迎玩家加入官方QQ群：191910744 。3、感谢楼友们继续支持我们的游戏.</div></div>',4.0,268294,'597170ec1d43e.apk',19.84,1,'com.starelement.virtualmall',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.9.6','com.starelement.component.plugin.migu_dianxin_liantong.TripleApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.starelement.virtualmall',0),
	(418,'智能拼图','597172dc063f1.png','597172db27c81.jpg,597172db378ae.jpg,597172db3e633.jpg,597172db4ad1c.jpg,597172db56ffe.jpg',130,'苏州天鸿嘉汇软件有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">这是一款能制作实景的拼图游戏，游戏包含20套左右的精美拼图模板，每个拼图都有4个难度等级，如果觉得不过瘾，那就打开相机，随时随地捕捉实景画面，制作拼图吧，新制作的拼图会自动出现在列表里，难度等级也自动生成了，慢慢挑战吧。能拍照并制作实景拼图的游戏。移动和跳转两种模式切换，带来不同乐趣。能从相册选取图片直接制作拼图。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">[程序] 升级内部SDK，调整相册图片选取界面默认打开路径，优化提示回退功能。[界面] 优化动画效果，美化应用界面。</div></div>',4.0,268296,'597172d25f488.apk',5.81,1,'org.vv.gameCell',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.98','org.vv.gameCell.MyApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=org.vv.gameCell',0),
	(419,'名门口袋学院2','59717302638cb.png','59717302026e3.jpg,597173022d660.jpg,597173023ad30.jpg,597173024774f.jpg',969589,'kairo工作室','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">《名门口袋学院2》以经营学校为主题，玩家需要做的主要工作就是通过各种设施、教学来提升学生教师的能力。当然，扩招高级教师也是你必须要考虑的事情，只有设备与教学质量跟得上脚步才可以有效地提高学生数量，这样才能使得学校正常良好的经营发展下去。值得一提的是游戏的学校经营，与现实的日本学校教育相当的接近。学校除了会举办一些球队邀请赛、艺术欣赏课及课题挑战之外，在校的学生也可以参加校外演出、培育动物等课外活动，这才是真正的学习啊！开罗的游戏碰不得，一玩就上瘾！麻雀虽小五脏俱全，研究布局、提高人气、合理经营等各种因素，会让你对这款游戏爱不释手。值得推荐的模拟游戏……</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">增加新的教师数据</div></div>',4.0,268298,'597172f62ec0e.apk',8.11,1,'net.kairosoft.android.school2_ja',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4.4.8',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=net.kairosoft.android.school2_ja',0),
	(420,'最美证件照','5974b1ab937d9.png','5974b1aa87da8.jpg,5974b1aadfd7b.jpg,5974b1ab23cf4.jpg,5974b1ab30ce5.jpg,5974b1ab5ccec.jpg',202,'成都品果科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">最美证件照由移动互联网摄影第一品牌Camera360出品，让你的证件照真实而又美丽！最美证件照 Android V2.0终于发布了！宝宝证件照、学生证件照、工作证件照在家做，9.9元冲印一版完美证件照！一款功能强大的证件照制作App，提供背景处理、美颜调整、服装更换功能，让你的证件照真实而又美丽。同时还能在线下单-冲印制作-送货到家的O2O服务。修改背景色+服装美颜调整+实物冲印+全国包邮 &nbsp;！欢迎狂热粉丝加入我们的QQ群：248407603</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1、提高支付网络稳定性2、修复使用崩溃问题</div></div>',3.0,269837,'5974b197ddb73.apk',12.98,1,'us.pinguo.idcamera',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2.0.2','com.pinguo.camera360.PgCameraApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=us.pinguo.idcamera',0),
	(421,'拼图酱','5974b1e645f74.png','5974b1e45ee7a.jpg,5974b1e4b0f99.jpg,5974b1e52a429.jpg,5974b1e57e75c.jpg,5974b1e5cf61e.jpg',24000,'成都品果科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">「拼图酱」夏夜里吹来一丝和煦凉风○◑一张照片怎足以讲出我们的故事？图片组合所传达的照片声音，远比完美的一张更重要。Camera360全新推出一款拼图应用——拼图酱，通过布局、磁贴、滤镜等元素重新组合照片，充满乐趣。拥有简单流畅的操作体验，无论是调整图片大小、修改布局或是反转照片都只需要简单的点击拖动即可完成。◆多样海报图片太寡淡，布局太简单，想要作品更出彩？！选择海报准没错。“装饰、美食、日常”，根据图片内容选择海报样式，滤镜款式一步到位，UP你的图片故事。◆你所想不到的滤镜特效点击图片更换滤镜，百款高质量滤镜，让你的拼图组合更有feel。文艺or胶片，漫画or渲染，单张or ALL，张张大片任君来。◆随意切换经典布局根据选择的照片自动生成各式模版，模版可依据不同需求切换至不同比例；◆创意磁贴“我在成都，加个定位”“今天下雨，加个忧郁标识”“为此刻的特别加个时间标签”……生动有趣的创意磁贴代替老式贴纸，定期更新。磁贴中一个个生动形象在各种少女系马卡龙颜色的搭配下，元气满满；◆社（zhuang）交（bi）神器将制作的作品发布到社交平台，与好友分享。现在，使用你的「拼图酱」讲讲故事吧！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">-设计师向你扔出拼图酱新logo，来！接住这只可爱的小狐狸；-拼图酱2017情人主题持续更新中！已准备好撩汉撩妹专用模板、贴纸，只等你来喔~！</div></div>',5.0,269837,'5974b1c62531a.apk',20.5,1,'us.pinguo.april_collage',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2.4.0','us.pinguo.april.MainApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=us.pinguo.april_collage',0),
	(422,'美页','5974b20b6bdc1.png','5974b20a9f5c5.jpg,5974b20accfd6.jpg,5974b20ae1a05.jpg,5974b20b1420a.jpg,5974b20b4a078.jpg',19,'北京云图微动科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">朋友圈晒图必备。让你定格的照片变成一部动态大片~全球首创动态照片模板！普通照片一秒变照片动画！超牛的美页分享社区，人人都是动画导演、创意大师！还仅仅满足于简单的照片式拼图？美页！照片的新玩法~【百种动态模板】集合自拍、复古、旅行、假日、节日等当下最IN元素动态模板，设计精致、动画细腻让你的照片更“美”，是第一追求！【配音更有feel】给你的照片，配上优雅、有情绪、充满故事性的背景音乐。在音乐、动画的衬托下，照片不再只是精致的图片，而是富有生命力的一段段动人的故事【随心添加照片】 bigger than bigger！不受照片张数限制，你可以随心在选定的模板里添加或删除照片！打破模板限制！【美页社区】想看男神女神？好玩创意？就来美页社区！和最潮、最有想法的的一群人一起晒自拍、晒美食、晒穿搭没有更有意思了的！【小贴士】新浪微博：http://weibo.com/gifrus/用户交流QQ群：86778885联系客服：support@fotoable.com广告合作：yanhui@fotoable.com（华东）lizhi@fotoable.com（华北）</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">***** 社交功能更强大 *****1. 新增【关注】功能。掌握好友动态！2. 新增【个人页】集中展示你的美页。3. 支持【修改个人信息】啦。4. 已发布的相册，可继续编辑。</div></div>',5.0,269837,'5974b1fa945f2.apk',10.98,1,'com.fotoable.instapage',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.45','com.fotoable.instapage.InstaPageApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.fotoable.instapage',0),
