	(425,'滤镜格子','5974b280ae863.png','5974b28008686.jpg,5974b2806793a.jpg,5974b28074767.jpg,5974b2807b819.jpg,5974b2809e692.jpg',28,'杭州格像科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">滤镜格子是一个神奇的拼接滤镜的app，通过预设的多种模版和滤镜，你可以轻松组合出各种神奇的效果。超过60种模版和70种滤镜组合，你可以尽情发挥你的想象力！主要功能：- &nbsp; &nbsp; &nbsp; &nbsp;60种神奇的模版多达60种神奇的模版，可以简单快速创造你的专属图片,一键编辑，无限精彩。 - &nbsp; &nbsp; &nbsp; &nbsp;超过70种令人惊叹的滤镜70种特色滤镜，任意组合自己最爱的效果，自定义创造专属于你的专属滤镜。 - &nbsp; &nbsp; &nbsp; &nbsp;能对每个格子区域单独编辑每个格子区域都能单独设置滤镜，调节亮度，对比度和饱和度，强大的编辑功能，每个格子都有专属的色彩。 - &nbsp; &nbsp; &nbsp; &nbsp;一键分享到社交网络轻松分享你的成果到各社交网络，和你的家人朋友分享，成为朋友圈的滤镜大师。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1.自然美颜升级，让你变得美美哒2.滤镜效果多重优化，画面更加完美哦3.修复部分bug,体验更加舒爽流畅</div></div>',5.0,269837,'5974b2728d33c.apk',8.87,1,'com.cam001.filtercollage',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.0.28_20170609','com.tencent.StubShell.TxAppEntry',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.cam001.filtercollage',0),
	(426,'食色','5974b2a009ffd.png','5974b29f3d62e.jpg,5974b29f63e74.jpg,5974b29f8a910.jpg,5974b29fac550.jpg,5974b29fd4605.jpg',311000,'逆柏网络科技（上海）有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">食与色，是我们生而为人浅薄却根植在灵魂的追求，是支撑我们在这坚硬的世界生存所需要的偶然的幸运。然而，你一定知道，这世上总有你不曾见的美色，总有你未曾尝的珍馐。 是无奈的抱憾，还是与“食色”里的生活家们一起，跳出“生存”的圈禁，用心去发现这世界更多美好的可能？用比前一秒更精致一点的眼光审视眼前的一粥一饭，一菜一汤？ “食色”请你一起来见，识，尝，试，生活的味道。食色有什么用？「根据场景找美食」周末吃什么？和闺密去哪里吃下午茶？生日聚餐去哪里？食色不再单纯的区分菜系口味，而是设身处地根据你的场景推荐美食，让你找美食的时候更容易！「美食店铺攻略」一家店不需要2000条点评，更不需要10000张图片，只需要让你知道「为什么值得吃」。所以食色编辑手动挑选了用户们的分享，以精美大图的方式为你概述店铺的亮点和推荐菜，并引用食色用户的真实点评，让你没有选择恐惧症！「结识和你一样懂生活的人」零食、烘焙、私房、品酒…… 相信爱吃的你并不局限在外面吃饭，说不定也是厨艺高手。所以在食色除了发现美食，还能结识更多和你一样的生活家，分享生活的里的点滴快乐。「晒美食的新方式」专属美食水印相机，超过200张美食水印与16种美食滤镜，让你分享到朋友圈的美食更诱人。相信你一定会让他们减肥失败的，不是么？一些小小的荣誉：- Appstore精华推荐- 腾讯大申网推荐吃货必备应用- 申江服务导报推荐吃货必备应用如果你更有一种冲动想要来和加入我们，那么请联系我们shise@mudlab9.com。世间所有的相遇，都是久别重逢。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">又有新版来咯~- 首页可以看到赞和评论的内容咯- 搜索改进，可以看附近和最新内容咯- 转发可以增加文字咯- 首页切换可以横向滚动咯- 解决了无法修改资料的问题</div></div>',4.0,269838,'5974b28e76a20.apk',11.4,1,'com.kingnez.umasou.app',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.1.1','com.qihoo.util.StubApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.kingnez.umasou.app',0),
	(427,'吉他独奏','5974b59ab5b69.png','5974b599a161c.jpg,5974b599b18f1.jpg,5974b599e7a00.jpg,5974b59a657e4.jpg,5974b59aa7551.jpg',193,'深圳市久正科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">一款音色很棒的模拟吉他软件。网上流传的一段“Android女”视频，视频中的女性利用Android手机的音乐应用软件演奏吉他，同时演唱了美国当红女歌手蕾哈娜的歌曲《TakeABow》，她用的吉它软件名字叫Solo，推荐大家使用，声音很棒！ 软件功能： 1、可以真实模拟木吉他的音效； 2、带有和弦图表库，使你可以听到和看到每个和弦的演奏； 3、可以创建自己的和弦； 4、先进的触觉效果； 5、许多设置来定制您的演奏风格； 6、功能绝对强大，Guitar爱好者的首选！ 【基本信息】 作者：codingcaveman 更新时间：2014-11-13 版本：1.70 系统：Android 2.3.3以上 语言：英文</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">新增更多乐谱优化应用性能，提高应用稳定性</div></div>',3.0,269836,'5974b58963ece.apk',10.66,1,'com.codingcaveman.Solo',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.93','com.tencent.StubShell.TxAppEntry',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.codingcaveman.Solo',0),
	(428,'凯叔讲故事','5974b5eb86332.png','5974b5ea95f15.jpg,5974b5eae5c1d.jpg,5974b5eb1cbfa.jpg,5974b5eb363bd.jpg,5974b5eb43b8f.jpg',330,'北京凯声文化传媒有限责任公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">适合2-12岁儿童，每月使用超过1500万次的育儿软件，600万家庭的听故事选择。哄睡故事，唤醒故事，日常故事，传统故事，节日故事，西游记，优质绘本故事，各年龄段宝宝喜欢的故事应有尽有，增强想象力和好奇心，养成好习惯，培养好品格。特色功能：1、【优质资源】全世界精选的原创好故事，每日更新。2、【省心省钱】定时休息、夜间休息，定时播放睡前诗。一键下载，免流量播放。2、【大咖主播】王凯，原央视主持人，凯叔讲故事创始人。2014年4月创立了“凯叔讲故事”，成为中国精品原创“讲故事”品牌，坚持“没有故事，不成童年”的理念，每天与600万个家庭亲密互动，用故事打造每个孩子的童年回忆。致力于呵护童心，培养孩子的阅读习惯，提升亲子沟通质量。3、【专家分类】根据不同年龄、场景对故事进行分类，满足孩子不同年龄不同阶段的需求。4、【自由定制】父母可以根据孩子的喜好，定制属于自己孩子专属的故事专辑。5、【古诗传承】凯叔作为中华好诗词的主持人，精选适合孩子听的古诗，为孩子潜移默化的传承中国古诗文化。任何问题或建议，请联系我们，欢迎大家加QQ群官方APP沟通群：155732634官方微信公众账号：凯叔讲故事 \r\n客服电话：400-060-9290</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1、全新的播放体验，长长的列表帮你分组，不记得听到哪个故事了，“上次听到这里”给你指引，新增内容预告，提醒你不要错过每个精品；2、支持高清大图，边听故事边看插画，声色俱全；3、《凯叔讲历史》即将上线，把五千年装进故事里。</div></div>',5.0,269836,'5974b5c0c60cb.apk',28.32,1,'com.ks.kaishustory',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.3.0','com.tencent.StubShell.TxAppEntry',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.ks.kaishustory',0),
	(429,'落网','5974b63a64b26.png','5974b6395f9f7.jpg,5974b639a260b.jpg,5974b639a9c8d.jpg,5974b639f3630.jpg,5974b63a5ed6a.jpg',206,'胡建国','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">落网是一个推荐国内外独立音乐的网站，我们致力于推荐这个时代里朴素、有质感的声音。如果你想听一些不一样的音乐、想遇到一些不一样的人，在落网，你的这个梦想会成真。落网一直坚持人工推荐音乐，我们始终认为：音乐是音乐人的感情衍生物，有感情地去推荐音乐会让大家更好地感受到音乐本身真挚的情绪。落网还提供海量的文章阅读，包括：音乐人专访、音乐知识、音乐行业相关互动、诗歌等内容。每篇文章都是编辑精选手动配乐，希望能够给你带来不一样的阅读试听体验。我们希望做的不是强加给你关于音乐的一切，而是让你与音乐面对面地交流，希望你在落网认识更多的歌，熟悉更多的人，能够跟落网一起成长，这就是落网真诚的想法。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">修复了一些bug并优化了一些小细节近期新增：- 期刊订阅专栏支持试听啦！- 期刊订阅专栏在首页就能看到当天的更新</div></div>',5.0,269836,'5974b60570694.apk',34.99,1,'net.luoo.LuooFM',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6.1.2','net.luoo.LuooFM.LuooApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=net.luoo.LuooFM',1),
