	(454,'海报工厂','5974c1443b22d.png','5974c14405088.jpg,5974c14411986.jpg,5974c1441bac8.jpg,5974c144291f7.jpg,5974c14435187.jpg',242,'厦门美图网科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">素材中心重磅推出“旅行”专题，让你尽享最美的风景！\r</br>【美图秀秀出品】最潮海报拼图神器！\r</br>海报工厂，让你的照片瞬间高大上！\r</br>\r</br>拥有杂志封面、电影海报、美食菜单、旅行日志等最潮海报元素，一秒打造视觉大片！\r</br>数百款精品素材，不管你是时尚范、欧美风、还是文艺范，总有一款适合你；\r</br>内置美图优质特效，完美打造视觉大片；\r</br>智能识别时间、天气、温度等实时信息，让海报美在每时每刻！\r</br>\r</br>【杂志封面】\r</br>超多杂志封面任你选，你永远是潮流焦点！ \r</br>\r</br>【电影海报】\r</br>极致视觉效果，打造你的专属电影大片！\r</br>\r</br>【美食菜单】\r</br>记录舌尖上的美味，分享自己的私人菜单！\r</br>\r</br>【旅行日志】\r</br>用海报珍藏最别致的旅行回忆。\r</br>\r</br>--友情提示--\r</br>官方网站：www.posterlabs.cn\r</br>用户反馈地址：android@meitu.com</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">美图秀秀出品！最潮海报制作神器！\r</br>海报工厂，照片瞬间高大上！\r</br>简约模板，收藏夏日美好时光！\r</br>修复Bug，解决闪退卡顿等问题~</div>\r\n            </div>\r\n            ',5.0,269836,'5974c1208f3b4.apk',23.86,1,'com.meitu.poster',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2.4.2','com.meitu.poster.PosterLabsApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.meitu.poster',0),
