	(471,'竞技摩托','597555b942d40.png','597555b7a2598.jpg,597555b801088.jpg,597555b85dbe6.jpg,597555b8dd844.jpg',5163111,'西橙（深圳）信息技术有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">竞技摩托Racing Moto这是一款会让您爱不释手，快节奏的摩托竞速游戏，在交通高峰时间控制你的摩托车，不断向前冲刺，你将能够享受令人难以置信的快速感!你还可以在旅途中享受美丽的景色：城市，桥梁，海上和森林!不过可不能碰到前面的车哦!游戏规则：1.倾斜手机来控制摩托车方向2.点击屏幕加快</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">修复部分死机BUG</div></div>',4.0,269836,'597555ae21541.apk',6.57,1,'com.droidhen.game.racingmototer',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'51.631.11','com.droidhen.game.racingmoto.global.SCApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.droidhen.game.racingmototer',0),
	(472,'跑酷老奶奶','59755604dfd18.png','59755603c5453.jpg,59755604265da.jpg,59755604334cf.jpg,597556048e031.jpg',400365,'东品西尚网络科技（北京）有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">　　《跑酷老奶奶》是一款刺激横版躲避动作游戏。游戏的主人公史密斯奶奶非常爱她的苹果，但是有小偷正在从花园中偷苹果！于是她穿上了旱冰鞋越过城市和农村，飞过谷仓和办公室，不顾一切只为了她的苹果！　　游戏节奏较快，充满了各种破碎和特技效果、跳、飘逸、滑行、粉碎等等，游戏有4个场景和56关卡和两种不同的难度，一定会让你爱不释手！需要注意的是落地的时候一定要脚先着地哦^^【游戏特点】 \r\n- 超炫的物理效果，使用了手机设备破坏物理引擎；- 炫目的视觉感受，几十个充满活力的世界，每个级别都像是一个美妙的立体故事书；- 简单直观的两键控制，完美支持平板电脑和手机； \r\n- 游戏重播，以复古电影风格观看你的游戏过程。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">是一款刺激横版躲避动作游戏。游戏的主人公史密斯奶奶非常爱她的苹果，但是有小偷正在从花园中偷苹果！于是她穿上了旱冰鞋越过城市和农村，飞过谷仓和办公室，不顾一切只为了她的苹果！</div></div>',4.0,269836,'597555d74b306.apk',30.21,1,'com.mediocre.grannysmith',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.0','.CmgameApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.mediocre.grannysmith',0),
	(473,'麒麟跑酷','5975562a1a592.png','59755628bedd3.jpg,597556291e117.jpg,5975562936479.jpg,59755629ba6b2.jpg',6,'上海皇石网络科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">麒麟跑酷是一个简单好玩的的跑酷游戏，非常刺激，画面精美，让你享受飞一般的感觉。一旦你开始玩，你就不会停止。这是一个令人上瘾的游戏，要挑战更高的分数，你还等什么呢？让我们gooooooooo！\r\n玩法：\r\n 1、点击左键跳跃，双击左键跳得更高。\r\n 2、点击右键进行强行突破障碍。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">更稳定、更优质，邀您一起体验。</div></div>',4.0,269837,'5975561c0b759.apk',7.37,1,'com.game.UnicornDash',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.2',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.game.UnicornDash',0),
