	(475,'节奏大师','5975568e1a5c6.png','5975568d54780.jpg,5975568d78271.jpg,5975568d9a377.jpg,5975568df2032.jpg,5975568e0a2d5.jpg',25101,'腾讯','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">节奏大师是一款老少皆宜的绿色音乐游戏,游戏方式在传统敲击音符玩法基础上加入滑动屏幕的操作方式、海量的中文音乐、丰富的歌曲类型、新颖的操作方式、世界排名挑战，节奏大师会让您体验到前所未有的演奏音乐的乐趣！音符下落式传统音乐游戏玩法，让你在手机上体验经典的VOS模式，游戏中针对触摸屏的特性加入音轨滑动音符，让你在游戏过程中体验到手指随着旋律跳舞的感觉歌曲谱面由专业音乐团队打造，确保每个谱面的手感保质保量！丰富的歌曲类型，包含中文、日韩、动漫、古典等音乐将不断通过网络更新，让您周周都有新歌体验，日日都有新难度挑战！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1、规范游戏内英文等装饰性文字词语的使用2、规范相关文字的输入与显示3、免费积分道具更名为留声音符4、增加举报好友头像功能</div></div>',5.0,269838,'5975562166270.apk',58.85,1,'com.tencent.game.rhythmmaster',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2.5.10.1',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.tencent.game.rhythmmaster',0),
	(476,'贪吃蛇大作战','597556bc9e4a9.png','597556bb7ffa6.jpg,597556bbb89c9.jpg,597556bbc6123.jpg,597556bbe6069.jpg,597556bc6a447.jpg',2056,'武汉微派网络科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">贪吃蛇大作战，这是一个有毒的游戏！\r</br>小时候玩的经典游戏《贪吃蛇》，现在华丽升级为《贪吃蛇大作战》，全新玩法等你来挑战！\r</br>这是一款超好玩的休闲竞技游戏，不仅比拼手速，更考验你的策略！在贪吃蛇大作战的世界中，每个人在初始都化身为一条小蛇，通过不断努力变得越来越长，最终制霸一方！\r</br>如果你喜欢贪吃蛇大作战，欢迎随时给我们留下宝贵的意见，推荐给好友一起来玩哦~\r</br>贪吃蛇大作战官方QQ群：584804947，593059856\r</br>更多资讯，请关注微信公众号【贪吃蛇大作战】，获取免费金币、贪吃攻略！</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">本次更新：\r</br>1、优化网络，提高游戏流畅度。\r</br>2、优化宝箱和团战模式若干bug。\r</br>3、修复部分用户无法修改头像的问题。\r</br>4、优化无尽模式和团战模式分数上传失败的问题。\r</br>近期更新：\r</br>1、新增【排位赛】2017季前赛火热开启，参加团战模式上王者段位，赢取超多奖励！\r</br>2、优化【团战模式】新增「BOSS大蛇」，击杀后全队获得加速提升；新增道具「磁铁」、「护盾」，更加刺激好玩！\r</br>3、优化【个人资料】新增地区位置、段位、游戏数据等。</div>\r\n            </div>\r\n            ',5.0,269836,'597556907c0d1.apk',14.85,0,'com.wepie.snake',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.4.6','com.wepie.snake.base.SkApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.wepie.snake',0),
