	(478,'3D极限摩托','597556d22f1b5.png','597556d091804.jpg,597556d0a5ef5.jpg,597556d0c5b16.jpg,597556d1b0989.jpg,597556d216abc.jpg',92336,'吕晓娟','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">3D极限摩托是一款从iOS平台上移植过来的3D摩托车游戏,在这款超酷的摩托车游戏中,你将会表演各种摩托车特技表演,展示出一些令人眼花缭乱的超酷动作!游戏中你将进入一个引人入胜的摩托车比赛中.这里,你和别人比的将不是摩托车的速度,而更多的是你车技.游戏采用重力感应和触摸屏控制,你能够利用你的Android手机让摩托车手玩出一系列的惊险动作,满足你的冒险愿望.</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">补充完善游戏帮助信息内容</div></div>',4.0,269837,'597556910add2.apk',21.43,1,'com.forjuan.trial',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.5.9',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.forjuan.trial',0),
	(479,'QQ游戏','597556df175df.png','597556de6b2bf.jpg,597556dead853.jpg,597556deb938b.jpg,597556dec62a1.jpg,597556df0afce.jpg',60636,'腾讯','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">腾讯游戏精心打造，14年经典品牌，地方棋牌麻将，尽在《QQ游戏》！【QQ游戏特色】精简的应用安装包，纯粹的棋牌麻将玩法，天天有比赛，时时拿奖励，随时随地来一局！【特色地方麻将】汇聚四川麻将、武汉麻将、哈尔滨麻将等全国地方麻将，给您最熟悉、最家乡的游戏体验！【经典牌类扑克】集合斗地主、升级、双扣、打大A、德州扑克等各类经典扑克玩法，对局乐趣精彩不停！【高端活动福利】刺激有趣的赛事活动，丰富多样的礼包福利，海量奖品，拿到手软！微信公众号：QQGame_2013官方QQ群：136606872</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">bug修复，体验提升~</div></div>',4.0,269839,'597556c7c275a.apk',11.9,1,'com.tencent.qqgame',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6.8.7','com.tencent.tpshell.TPShellApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.tencent.qqgame',0),
	(480,'捕鱼达人3(天天送金币)','59755728d3905.png','5975572850f94.jpg,59755728793af.jpg,597557288c2d1.jpg,59755728975ca.jpg,59755728a6d24.jpg',119,'北京触控科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\">\r\n                <div class=\"det-app-data-info\">《捕鱼达人3》是触控科技旗下捕鱼系列游戏全新一代产品，cocos2d-x3.0引擎打造全新3D画面，革命性创新玩法带来颠覆体验。2014年国民级休闲手游全球震撼上线，全民捕鱼欢乐升级，人人都是捕鱼达人！</div>\r\n                <div class=\"det-app-data-tit\">更新内容：</div>\r\n                <div class=\"det-app-data-info\">2017年新年的钟声马上就要敲响了，在这里感谢渔民们一直对《捕鱼3》的喜爱，祝大家在新的一年家庭美满幸福，身体健康~~~\r</br>鱼鱼们同时也给大家带来的新的版本，本次版本更新内容如下：\r</br>本次1.18版本更新内容具体如下： \r</br>1.	增加春节限时大礼包；\r</br>2.	春节新气象，鱼鱼们大换装；\r</br>3.	优化部分数据；\r</br>4.	开启春节活动，万元京东卡等你来拿；</div>\r\n            </div>\r\n            ',4.0,269836,'597556e072e70.apk',48.41,1,'org.cocos2d.fishingjoy3',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.1.9','org.cocos2d.fishingjoy3.FishingJoy3Application',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=org.cocos2d.fishingjoy3',0),
	(481,'一个都不能死','597557394a549.png','59755738d2719.jpg,59755738d9f18.jpg,5975573923aa4.jpg,597557392b0a0.jpg,597557393781d.jpg,59755739445a4.jpg',1840,'长沙睿哲软件有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">风靡全球的火柴人跑酷！极具创意&amp;个性！可联机对战！全球累计超过4千万下载！第一名多个国家！全新刺激玩法疯狂来袭：《经典》《生存》《逃生》《暴走》《囧途》《暴跳》《插花》《蛋跳》《穿梭》...每一种玩法都与火柴人完美结合~极具挑战！简约而不简单！超过千万用户点赞的超牛游戏！ “炼狱模式”有木有超过10秒的小伙伴？最多可控制36个火柴人跑酷(全新升级! 36个？Impossible？)，想要挑战极限的朋友快来试试吧~-启动标志为RINZZ的为官方正版游戏特点：- 测试你的敏捷和反应速度 - 测试你的手脑并用- 疯狂与刺激与抓狂 - 你需要快速和敏捷- 玩“一个都不能死”结交你的生死朋友〜- 邀请好友，共创高分- 经典与生存+隐藏模式6个难度等级- 全语言的支持关注我们： http://weibo.com/ringapps微信公众号：热因子独立游戏QQ1群：154630495，QQ2群：466513930</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">-全新伐木模式-游戏更加顺畅丝滑，让我们High起来吧~-修复了一些BUG；-优化了一些细节；-添加了一笔免费金币；&gt;&gt;启动Logo为RINZZ的为官方正版！&gt;&gt;关注我们：http://weibo.com/ringapps&gt;&gt;官方网站：http://www.rinzz.com&gt;&gt;微信公众号：热因子独立游戏&gt;&gt;QQ群1：154630495QQ群2：466513930</div></div>',5.0,269839,'597557291ddd6.apk',10.54,1,'com.rinzz.noonedies',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.8.4','com.tencent.StubShell.TxAppEntry',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.rinzz.noonedies',0);
