VALUES
	(482,'热血乒乓','597557435f25a.png','5975574263d8f.jpg,597557428f571.jpg,59755742aff35.jpg,59755742dfe80.jpg,597557433db76.jpg',36,'FireStar','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">《热血乒乓》是一款真实的乒乓对战游戏。畅快的打击手感，简单的操作体验，更有几率触发扣杀模式，一击致命！游戏考验反应力，开始你会觉得很难，但是几个回合之后你会掌握技巧和规律，来看看你能赢下几个回合吧~~ \r\n游戏特色： \r\n-爽快的扣杀和击球效果 \r\n-有一定规律和技巧赢球 \r\n-随着回合数增加，难度递增</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1.优化了游戏细..。。。</div></div>',5.0,269837,'59755737d9779.apk',5.13,1,'com.gamedroid.dev.pingpang',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.6','com.stub.StubApp',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.gamedroid.dev.pingpang',0),
	(483,'中国象棋单机','597557628de98.png','5975576100c04.jpg,59755761a848f.jpg,59755761bd9a5.jpg,5975576230498.jpg',3574,'北京酷酷跑科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">中国象棋在中国有着悠久的历史，属于二人对抗性游戏的一种。由于用具简单，趣味性强，成为流行极为广泛的棋艺活动。中国象棋具有单机模式，可以和电脑一较高下，又可以和朋友一起娱乐，居家游玩必备品。假如这一切都无法满足，还有100多经典棋局等你来破，快来证明你的象棋实力吧。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1：修复了部分机型闪退2：增加了返回退出键</div></div>',3.0,269837,'5975574c80c74.apk',8.94,1,'com.happy.chinesechessfsg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.5.3','com.tencent.StubShell.TxAppEntry',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.happy.chinesechessfsg',0),
	(484,'3D终极车神','597557751db91.png','5975577236876.jpg,59755772e7df0.jpg,5975577376bda.jpg,5975577441967.jpg,59755774b70f0.jpg',18,'百度移信网络技术（北京）有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">3D终极车神首届王者争霸赛开启啦，速度！激情！豪车！美女！黄金！导弹！2秒钟让你high到400迈，激发你的肾上腺素，给你极速狂飙血脉喷张的飞车体验！14辆最酷最奢华的顶级跑车，数十个精妙设计的关卡，瞬间给你最刺激的驾驶享受，漂移、加速、追逐、冲撞、飞弹，加上逼真的音效，领略热血澎湃的赛车场面。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">计费优化bug修复</div></div>',3.0,269837,'597557515438d.apk',11.16,1,'project.zjsc3d.tx',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.2.0','cn.eden.MyApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=project.zjsc3d.tx',0),
	(485,'天天象棋','5975579c65abd.png','5975579b54ac0.jpg,5975579bc2112.jpg,5975579be06d2.jpg,5975579c2eaaa.jpg,5975579c37676.jpg',28401,'腾讯','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">腾讯出品的《天天象棋》风格清新休闲，质朴耐玩而不失时尚。拥有的游戏特色:1）.棋力评测：广大棋友公认的棋力评测系统。2）.残局闯关3）.旁观对局4）.复盘打谱：支持创建棋谱、添加注释、变着等。5）.棋社私人房：方便棋友建立棋社，开展比赛。6）.棋谱收藏：海量古谱可供下载，如：教你学开局、橘中秘、梅花谱。7）.翻翻棋：休闲娱乐，寻找儿时的记忆。8）.揭棋：源于港澳台地区，无法AI作弊的象棋玩法。9）.直播：国家大师直播教你提高棋力。10）.棋友系统:约战、聊天、交友。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1、新增话费赛，公平赛制赢奖品2、新增揭棋好友榜和世界榜3、好友在线提示，约战好友更方便4、新增恶意留言屏蔽功能5、优化棋子卡死问题，弱网络下棋异常问题6、优化象棋棋规，解决长捉耍赖问题</div></div>',4.0,269836,'5975576318e0b.apk',29.42,1,'com.tencent.qqgame.xq',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2.8.4.1',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.tencent.qqgame.xq',0),
	(486,'竞技摩托','597557a6d801a.png','597557a66494b.jpg,597557a699410.jpg,597557a6b2fe3.jpg,597557a6cbac4.jpg',5163111,'西橙（深圳）信息技术有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">竞技摩托Racing Moto这是一款会让您爱不释手，快节奏的摩托竞速游戏，在交通高峰时间控制你的摩托车，不断向前冲刺，你将能够享受令人难以置信的快速感!你还可以在旅途中享受美丽的景色：城市，桥梁，海上和森林!不过可不能碰到前面的车哦!游戏规则：1.倾斜手机来控制摩托车方向2.点击屏幕加快</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">修复部分死机BUG</div></div>',4.0,269839,'59755791e1728.apk',6.57,1,'com.droidhen.game.racingmototer',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'51.631.11','com.droidhen.game.racingmoto.global.SCApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.droidhen.game.racingmototer',0),
	(487,'军棋','597557ad90d1a.png','597557acdcb2c.jpg,597557ad06abd.jpg,597557ad267e9.jpg,597557ad46484.jpg,597557ad62f6a.jpg',152,'郭况','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">军棋，又名陆战棋，相信大家一定玩过。这是一款界面精美、功能丰富的军棋游戏。 1. 支持人机对战，两人对战，联网对战，蓝牙、Wi-Fi联机对战。人机对战可选择多个难度级别。 2. 支持翻棋、布局，暗棋、明棋共四种玩法。 3. 可以编辑、载入和保存布局，并提供大量预置的参考布局。 4. 布局暗棋具有标志对方棋子的功能。 5. 可以设置玩法细节：如由工兵还是最小的棋子挖地雷，大本营是否允许吃子等。 6. 电脑对手相当聪明，想战胜它除了需要策略，还需要一点运气。 7. 蓝牙联机对战如果出现连接失败的情况，请尝试在蓝牙设置中先进行配对或者换个人创建游戏。 8. Wi-Fi联机对战需要双方接入同一个无线局域网。 9. 游戏菜单中有详细的规则说明。快来尝试一下吧！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1.52版本更新内容：1. 布局暗棋和四国军棋人机对战支持复盘功能。2. 调整四国军棋人机对战电脑级别。3. 优化联机对战和联网对战聊天界面。</div></div>',4.0,269839,'5975579ca1044.apk',7.21,1,'com.cnvcs.junqi',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.52',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.cnvcs.junqi',0),
