	(510,'天天炫斗','59755b4870a59.png','59755b477f313.jpg,59755b47c1bcc.jpg,59755b47c9440.jpg,59755b4834bab.jpg,59755b486a4a6.jpg',35000504,'腾讯','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">天天炫斗“拜师收徒”新版本即将开启！各位炫斗勇士们快来跟全新角色神乐铃音一起，探索拜师收徒等精彩内容！天天炫斗是腾讯第一实时PK动作手游，具有炫酷的格斗画面和超爽快的打击手感。游戏角色个性迥异、技能华丽酷炫，无限连击的全屏大招，给人带来动作游戏巅峰体验！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">《天天炫斗》暑期版本清爽来袭，全新职业与炫斗勇士们一起清凉一夏！古老神秘家族的传人神乐铃音，在舞蹈中参悟出了武道真谛；拜师收徒功能开启，大神师父和可爱小徒一起炫斗；拍卖行全面革新，自由交易再度升级；布鲁异能档案开启，丰富剧情等你挑战；开放装备洗炼，特殊属性由你打造；增加竞技属性，实战能力一目了然。更有超嗨盛夏活动同期上线，全民狂欢正当下！</div></div>',5.0,269838,'59755b052b070.apk',36.93,1,'com.tencent.game.VXDGame',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.35.425.1','com.tencent.game.VXDGame.VXDApp',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.tencent.game.VXDGame',3),
