	(512,'泡泡龙 Shoot Bubble Deluxe','59755b929870d.png','59755b90b66bc.jpg,59755b90c813d.jpg,59755b91add25.jpg,59755b91b541f.jpg,59755b91edea9.jpg',39000,'深圳市歌派信息科技有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">这是最为经典的泡泡消除类游戏。这款华丽版泡泡龙是唯一一款包含解谜模式和街机模式的游戏。连接3个以上泡泡来消除它们。清除屏幕中所有的泡泡就可以升级了。玩法：不要使用屏幕下面的箭头，直接点击屏幕中你想射击的位置即可。点击menu键可以设置游戏背景和其它选项。游戏特点：1. 解谜模式——超过300个有趣的关卡。2. 街机模式——泡泡会逐渐在下降，所以速度要快点哦。3. 游戏中心——每消除一个泡泡就能得到10分，可以在全球计分榜上记录下你的高分。</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">稳定性改进和错误修正。</div></div>',4.0,269837,'59755b85f00ba.apk',3.06,1,'com.shootbubble.bubbledexlue',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3.9',NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.shootbubble.bubbledexlue',0),
	(513,'2048中文版','59755bb7b9caf.png','59755bb6d6db9.jpg,59755bb7181db.jpg,59755bb7265c5.jpg,59755bb732174.jpg,59755bb781b20.jpg',NULL,'深圳市四海软件有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">2048，一上手就根本停不下来的益智游戏！手指轻划，相同数字合并生成新的数字，直到合成传奇中的2048！还没把2048玩现形过？在全新的2048中文版里，你可以轻松做到！在这个版本里，保留了原来正宗的玩法，还是熟悉的数字，但改良增加了新的本地化特色技能。在2048中文版中，你拥有了再来一次的机会！--不，事实上是两次或更多次的机会！你可以选择重新排列一次，或后退一步来盘活整个组合！2048玩法新技能Get√，重生的机会，握在你自己的手里！新传奇的辉煌，由你亲自创造！</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">1. 更新支付SDK；2. 修复一些安卓系统兼容的问题；3. 优化游戏体验，修复小BUG；4. 游戏功能优化，完善调整；5. 游戏数值调整优化</div></div>',5.0,269837,'59755baa82cd7.apk',3.6,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.longkoo.two',0),
	(514,'登山赛车','59755bbb8e84e.png','59755bba86a63.jpg,59755bbac89cd.jpg,59755bbad9a24.jpg,59755bbaea544.jpg,59755bbb05525.jpg,59755bbb4ae04.jpg',144,'北京唯我乐园信息技术有限公司','<div class=\"det-intro-text\" id=\"J_DetAppDataInfo\"><div class=\"det-app-data-info\">《登山赛车》是一款超有趣的物理赛车手游。游戏基于真实赛车特性开发，仅需两键就能驰骋各类赛道。新版本加入了“车库系统”，玩家可手动改装赛车，打造专属于你的“骚气”车型。丰富有趣的”零件卡牌”登场，不仅满足老司机们的收藏癖，更有助于提升赛车性能。游戏新增“推进器”玩法，让赛车一秒飙出油门超高速度。更有过山车轨道、银河系赛道、全新礼包系统、海量宝箱带来疯狂飙车体验。快来和老司机“比尔”玩转地球，尽情翻滚跑出高分吧！ &nbsp; &nbsp; 该作全球下载量超5亿，登顶全球应用商店下载榜前十。- 新增“推进器”道具 \r\n- 新增兑换码功能- 新增车库系统- 新增普通宝箱、银质宝箱、金质宝箱</div><div class=\"det-app-data-tit\">更新内容：</div><div class=\"det-app-data-info\">《登山赛车》是一款风靡全球的趣味驾车游戏，下载量已超5亿，2013-2014连续两年全球App Store与Google Play下载TOP 10。游戏提供丰富的特色车辆供玩家选购改装，基于真实物理特性，仅需油门和刹车两键，就可在各种地形上驾车奔驰。游戏考验的是技巧性，如何让车辆尽情飞跃跑出高分，更多乐趣等您发现！版本更新:- 新增车库系统 &nbsp;1. 可自定义专属赛车，总共5种类别。 &nbsp;2. 收集卡牌进行底盘、引擎、轮胎的升级 &nbsp;3. 搭配不同类型的底盘、引擎、轮胎可适用于特定地图- 新增普通宝箱、银质宝箱、金质宝箱</div></div>',4.0,269837,'59755b5169d40.apk',57.67,1,'com.fingersoft.hillclimb',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'1.42.1','com.mygamez.common.MySDKApplication',NULL,'http://sj.qq.com/myapp/detail.htm?apkName=com.fingersoft.hillclimb',0),
